import React,{useState,useEffect} from 'react';
import axios from "axios";
const Myfunction=()=>
{
  const [items, setItems]=useState([]);
  useEffect(()=>{
    axios.get("localhost/hotelbackend/getdata.php").then(res=>{
      setItems(res.data);
    });
  },[]);
}
export default Myfunction.items;
